import React from 'react';
import './App.css';  // Optionally include global styles
import ImageUploader from './ImageUploader';  // Import the ImageUploader component

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to the Image Feature Extraction App</h1>
        <p>Upload an image and extract its features, then find the most similar images!</p>
      </header>
      <main>
        <ImageUploader />  {/* Render the ImageUploader component here */}
      </main>
    </div>
  );
};

export default App;
